import React, { Component } from 'react'
import Spinner from 'react-bootstrap/Spinner';

export class Test extends Component {
    constructor(props) {
        super(props)

        this.state = {
             loading: false
        }
    }

    fakeCall = () => {
        this.setState({
            loading: true
        })
    }

    render() {
        return (
            <div>
                <button onClick={this.fakeCall}> Make something happen </button>
            </div>
        )
    }
}

export default Test
